import React,{Component} from "react";
import { Link } from 'react-router-dom';
import './Home.css';

class Home extends Component{

  render () {
    return (
      <div className="Home-header">
          <Link to="/signIn" className="SignIn"> <Button className="button">Iniciar Sesion</Button> </Link>
      </div>
    );
  }
}

export default Home;
